import React,{useState} from 'react';
import image from '../resources/logo.png';


const Navbar = () => {
   const [theme, setState] = useState(false);
    const themed=()=>{
    if(theme === false){
        cssStyle
        setState(true)
    }else{
        setState(false)
    }

    
}
    
    return (
        <div>
        <div className='bodypart'>
            <div className="Navbar">
                <div className='Logo'>
                    <img src={image} alt='logo'/>
                </div>
                <div className='Serchbox'>
                <h1>+</h1>
                    <input type="text" placeholder='Serch for intrest'/>
                </div>
                <div className='theme'>
                    <input type = "checkbox" onChange={themed}/>
                </div>
                <div className='links'>
                    <a href='#aboutme'>About Me </a>
                    <a href="#project">Project </a>
                    <a href="/">Info </a>
                    <a href="/">Feedback </a>
                    <a href="/">Contact </a>
                </div>
            </div>
            </div>
        </div>
    );
}

export default Navbar;
